import './App.css';
import { useState } from 'react';

function App() {
  const [count,setCount] = useState(0)
  const onClick = () =>{
    setCount(count+1)
  }
  return (
    <div className="App">
      <h1>{count}</h1>
      <button onClick={onClick}>증가</button>
    </div>
  );
}

export default App;
